import numpy as np
import pandas as pd

def getArchConfigParamsFromDie(no_of_modules, no_of_ring_weighing_blk, arch_start_block_indx,no_of_blocks_x_for_imprint,no_of_blocks_x_for_preweigh, ER_config, Q_config, LAMDA_R_config, FINESSE_config):
    arc = {}
    demul_mr = {}
    mul_mr = {}
    block_row_idx = 0
    block_column_idx = arch_start_block_indx
    block_size = 200  # um
    pitch = 200  # um
    block_increment_in_x = int(block_size / pitch)
    # assign the multiplexer adn demultiplexer micro rings
    # print("nlamda",no_of_ring_weighing_blk)
    # print("no_of_ring_weighing_blk",block_row_idx)
    # print("block_column_idx",block_column_idx)
    for lamda in range(no_of_ring_weighing_blk):
        config_params = {}
        config_params['Q'] = Q_config[block_row_idx][block_column_idx]
        config_params['ER'] = ER_config[block_row_idx][block_column_idx]
        config_params['LAMDA_R'] = LAMDA_R_config[block_row_idx][block_column_idx]
        config_params['FINESSE_R'] = FINESSE_config[block_row_idx][block_column_idx]
        demul_mr['mr_w' + str(lamda)] = config_params
        block_row_idx += block_increment_in_x
    # assign the demultiplexer
    block_row_idx = 0
    block_column_idx +=  no_of_blocks_x_for_imprint
    for lamda in range(no_of_ring_weighing_blk):
        config_params = {}
        config_params['Q'] = Q_config[block_row_idx][block_column_idx]
        config_params['ER'] = ER_config[block_row_idx][block_column_idx]
        config_params['LAMDA_R'] = LAMDA_R_config[block_row_idx][block_column_idx]
        config_params['FINESSE_R'] = FINESSE_config[block_row_idx][block_column_idx]
        mul_mr['mr_w' + str(lamda)] = config_params
        block_row_idx += block_increment_in_x
    # leave block between multiplexer and weight block
    block_row_idx = 0
    block_column_idx += no_of_blocks_x_for_preweigh




    for module_id in range(no_of_modules):
        module = {}
        array = {}

        for ring_pair in range(no_of_ring_weighing_blk):
            #weighing block
            config_params = {}
            config_params['Q'] = Q_config[block_row_idx][block_column_idx]
            config_params['ER'] = ER_config[block_row_idx][block_column_idx]
            config_params['LAMDA_R'] = LAMDA_R_config[block_row_idx][block_column_idx]
            config_params['FINESSE_R'] = FINESSE_config[block_row_idx][block_column_idx]
            array['mr_w' + str(ring_pair)] = config_params
            block_column_idx = block_column_idx + block_increment_in_x
            module['array' + str(block_row_idx)] = array
        arc.update({'module' + str(module_id): module})
    return arc, demul_mr, mul_mr
